import Api from '@/utils/Api'

export function CreateCampaignAction(data) {
    Api.CreateCampaignAction(data)
        .then(res => {
            if (res) {
                console.log('CreateCampaignAction' + res)
            }
        })
        .catch(err => {
            console.log('error CreateCampaignAction', err)
        })
}
